import React, { Component } from 'react';

class Sidebar extends Component {
  render(){
    return (
      <nav className="sidenav">
        <div className="app_name">
          <img className='logo' src={process.env.PUBLIC_URL + this.props.logo.svg} alt="" width='50px'/>
          <span className="brandName">{this.props.logo.name} </span>
        </div>
        <ul className="main-buttons">
          {this.props.items.map(item=>{
            return (
              <li key={item.id}>
                <i className={item.icon}></i>
                <span>{item.main}</span>
                <ul className="hidden">
                  {item.subs.map(sub=>{
                    return (
                      <li key={sub.id}>{sub.name}</li>
                    )
                  })}
                </ul>

              </li>
            );
          })}
        </ul>
        <div className="end">
          <a href="/">
            <i class="fas fa-home"></i>
            <span>Home</span>
          </a>
        </div>
      </nav>
    
  )};
}

export default Sidebar;
